script: |
  super -f text -I q13776.spq | sort > q13776.out

inputs:
  - name: q13776.spq
    data: |
      SELECT DISTINCT col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - 48 / - col1 * + col0 / + - col0 NOT BETWEEN ( col2 - + 78 ) AND - 61 * - col0 + + 17 / 39;
  - name: tab1

outputs:
  - name: q13776.out
    data: |
      51
